import {useState} from 'react';
import Header from '../Components/Header';

const Fight = () => {

    return(
       <div className="dojo">
           <header>
                <Link to="/"><h1>KDM</h1></Link>
                <Link to="/about"><p>About</p></Link>
                <Link to="/home" onClick={() => setKanji([])}><p>Home</p></Link>
            </header>
       </div>
    )
}

export default Fight;
